import React, { useState } from 'react';
import { TextField, Button, Grid, Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material';

function App() {
  const [value, setValue] = useState('');
  const [notes, setNotes] = useState([]);

  const handleClick = () => {
    setNotes([...notes, value]);
    setValue('');
  };

  const handleChange = (e) => {
    setValue(e.target.value);
  };

  return (
    <Grid container spacing={2}>
      <Grid item xs={6}>
        <TextField
          label="Note"
          variant="outlined"
          value={value}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
      </Grid>
      <Grid item xs={2}>
        <Button variant="contained" color="primary" onClick={handleClick} fullWidth>
          Add Note
        </Button>
      </Grid>

      <Grid item xs={12}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Value</TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {notes.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{index}</TableCell>
                <TableCell>{row}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Grid>
    </Grid>
  );
}

export default App;
